<?php


namespace app\api\controller\wx;


use app\common\enums\ErrorCode;
use app\common\model\wx\WeChatApplet;
use app\common\vo\ResultVo;

class AppletController
{

    /**
     * 获取群id
     */
    public function openGid()
    {
        $code = request()->post("code");
        $encryptedData = request()->post("encryptedData");
        $iv = request()->post("iv");
        $wxa_from = request()->param("wxa_from/d", 0);
        $gid_info = WeChatApplet::getInstance($wxa_from)->getOpenGid($code, $encryptedData, $iv);
        if (empty($gid_info["openGid"])) {
            return ResultVo::error(ErrorCode::DATA_NOT, "没有获取到群id");
        }
        $res = [];
        $res["gid"] = $gid_info["openGid"];
        return ResultVo::success($res);
    }

    /**
     * 获取code码
     */
    public function getCode()
    {
        $scene = request()->param("scene");
        $page = request()->param("page");
        $width = request()->param("width/d");
        $wxa_from = request()->param("wxa_from/d", 0);
        $code_img = WeChatApplet::getInstance($wxa_from)->wxaCode($scene, $page, $width);
        if (!$code_img) {
            // 生成失败
            $base_img = "";
            $code_img = imagecreatefromstring(base64_decode($base_img));
        }
        header('content-type:image/jpg;');
        imagejpeg($code_img);
        exit;
    }


}